import { useState, useEffect } from "react";
import { Card, Space, Button } from 'antd';
const { Meta } = Card;

export default function FruitCard(item) {
    <Card
        style={{
        width: 200,
        margin: 20,
        padding: 0,
        }}
        cover={
        <img
            alt="example"
            src={item.image}
        />
        }
    >
        <Meta
        title={item.name}
        />
        <p>Price: ${item.price} </p>
        <p>Season: {item.season} </p> 
        <p>Type: {item.type} </p> 
        <Button onClick={() => addToCart(item)}>Add or Remove</Button>
    </Card>
}
